import fetch from "cross-fetch";
//const xx = "https://cors-anywhere.herokuapp.com/";
const APIBaseUrl = "http://54.87.169.150:8081/";
export const LoginService = async ({ username, password, operation }) => {
  try {
    const response = await fetch(
      `http://54.87.169.150:8081/faculty/LoginServlet`,
      {
        method: "POST",
        //mode: "no-cors",
        headers: {
          "Access-Control-Allow-Origin": "*",
        },
        body: JSON.stringify({
          username,
          password,
          operation,
        }),
      }
    );
    const data = await response.json();
    return data;
  } catch (error) {
    console.log(error);
  }
};
